    false,nt"url": null,nt"notes": "This Water Resource Inventory and Assessment
    (WRIA) Summary Report for Ottawa National Wildlife Refuge Complex (ONWRC) describes
    current hydrologic information, provides an assessment of water resource needs and
    issues of concern, and makes recommendations regarding Refuge water resources. This
    Summary Report synthesizes a compilation of water resource data contained in the
    national interactive online WRIA database (https://ecos.fws.gov/wria/). The information
    contained within this report and supporting documents will be entered into the national
    database for storage, online access, and consistency with future WRIAs. The database
    will facilitate the evaluation of water resources between regions and nationally.
    This report and the database are intended to be a reference for ongoing water resource
    management and strategy development. This is not meant to be an exhaustive nor a
    historical summary of water management activities at ONWRC.",nt"license_title":
